import { Outlet } from  "react-router-dom";
import React from "react";
import NavBarComponent from "./NavBarComponent";
import BlurBodyComponent from "./BlurBodyComponent";
({children}) => {
    return (
        <>
        <NavBarComponent />
        <BlurBodyComponent children={children} />
        <Outlet />
        </>
    )
}
export default L
